ProfilingServiceAsyncWaiter::ProfilingServiceAsyncWaiter(ProfilingService* proxy)
    : proxy_(proxy)
{
}

ProfilingServiceAsyncWaiter::~ProfilingServiceAsyncWaiter() = default;

void ProfilingServiceAsyncWaiter::AddProfilingClient(::base::ProcessId pid, ::mojo::PendingRemote<::heap_profiling::mojom::ProfilingClient> client,
    ProcessType process_type, ::heap_profiling::mojom::ProfilingParamsPtr params, bool* out_success)
{
    base::RunLoop loop;
    proxy_->AddProfilingClient(std::move(pid), std::move(client), std::move(process_type), std::move(params),
        base::BindOnce(
            [](base::RunLoop* loop, bool* out_success, bool success) {
                *out_success = std::move(success);
                loop->Quit();
            },
            &loop, out_success));
    loop.Run();
}

bool ProfilingServiceAsyncWaiter::AddProfilingClient(::base::ProcessId pid, ::mojo::PendingRemote<::heap_profiling::mojom::ProfilingClient> client,
    ProcessType process_type, ::heap_profiling::mojom::ProfilingParamsPtr params)
{
    bool async_wait_result;
    AddProfilingClient(std::move(pid), std::move(client), std::move(process_type), std::move(params), &async_wait_result);
    return async_wait_result;
}

void ProfilingServiceAsyncWaiter::GetProfiledPids(std::vector<::base::ProcessId>* out_pids)
{
    base::RunLoop loop;
    proxy_->GetProfiledPids(base::BindOnce(
        [](base::RunLoop* loop, std::vector<::base::ProcessId>* out_pids, const std::vector<::base::ProcessId>& pids) {
            *out_pids = std::move(pids);
            loop->Quit();
        },
        &loop, out_pids));
    loop.Run();
}

std::vector<::base::ProcessId> ProfilingServiceAsyncWaiter::GetProfiledPids()
{
    std::vector<::base::ProcessId> async_wait_result;
    GetProfiledPids(&async_wait_result);
    return async_wait_result;
}

